function EquipConfig.GetConfig(key)
	local tb = EquipConfig.Values[key]
	if not tb then
		print_error(string.format("key type is %s,key = %s",type(key),key))
		return nil
	end
	local config = {["id"] = 1,["smalltype"] = 2,["quality"] = 3,["qualityname"] = 4,["name"] = 5,["describe"] = 6,["mainattrvalues"] = 7,["viceattrvalues"] = 8,["icon"] = 9,["sale"] = 10,["exp"] = 11,["sortid"] = 12,["dialogue"] = 13,["gainway"] = 14,["exclusive"] = 15,["nazo"] = 16,}
	for k,v in pairs(config) do
		config[k] = tb[v]
	end
	return config 
end
return EquipConfig